%%spark
import org.apache.spark.sql.functions.trim
import org.apache.spark.sql.functions.{col, date_format}


//Reading data from staging tables
var ot_df = spark.read.synapsesql("dedicatedsqlashutosh.dbo.salesjson") 
ot_df = ot_df.withColumn("source", lit("Json"))

var csv_df = spark.read.synapsesql("dedicatedsqlashutosh.dbo.salescsv") 
csv_df = csv_df.withColumn("source", lit("CSV"))

var parq_df = spark.read.synapsesql("dedicatedsqlashutosh.dbo.salesparquet") 
parq_df = parq_df.withColumn("source", lit("Parquet"))

//Appending the dataframes
var df = ot_df.union(csv_df).union(parq_df)

//Replacing NULL Values
df = df.withColumn("quantity", when(col("quantity").isNull,col("total_amount")/col("price")).otherwise(col("quantity")))

df = df.withColumn("price", when(col("price").isNull,col("total_amount")/col("quantity")).otherwise(col("price")))

df = df.withColumn("total_amount", when(col("total_amount").isNull,col("price")*col("quantity")).otherwise(col("total_amount")))

//Removing time from data column
df = df.withColumn("sale_date_new", split(col("sale_date"), " ").getItem(0))

//Creating year column from sale date
df = df.withColumn("year", split(col("sale_date_new"), "-").getItem(0))

//Rounding price,amount to decimal places
df = df.withColumn("total_amount", bround(col("total_amount"), 2))
df = df.withColumn("price", bround(col("price"), 2))
df = df.withColumn("quantity",bround(col("quantity"),0))

val adlsPath = "abfss://dp203-datalakegen2@ashutoshstorage1.dfs.core.windows.net/data_transformed/Data_Transformed.csv"

// Write DataFrame to ADLS in CSV format
df.write
  .format("csv")
  .option("header", "true")
  .mode("overwrite")
  .save(adlsPath)
